import introPhoto from '../../assets/intro.png';
import styled from 'styled-components';

const IntroWrapper = styled.div``;
const IntroPhoto = styled.img`
  width: 100%;
`;

export default function Intro() {
  return (
    <IntroWrapper>
      <IntroPhoto src={introPhoto} />
    </IntroWrapper>
  );
}
